import store from "../redux/store";
import Axios from "axios";
import * as syncActions from "./syncActions";
import ActionTypes from "../redux/actionTypes";

export const getupscquestion = dispatch => {
  Axios.get("http://localhost:8500/upsc/getallquestions")
    .then(response => {
      console.log("sent successfully", response.data);
      store.dispatch(syncActions.getUpscQuestions(response.data));
    })
    .catch(err => {
      console.log(err);
    });
};

export const getupscSubjectQuery = (dispatch, req) => {
  console.log("req", dispatch);
  const data = { subject: req };
  Axios.post("http://localhost:8500/upsc/get-subject-query", data)
    .then(response => {
      console.log("sent successfully", response.data);
      dispatch(syncActions.getUpscSubjectQuery(response.data));
      // store.dispatch({
      //   type: ActionTypes.UPSC_SUBJECT_QUESTIONS_LOADED,
      //   payload: response.data
      // });
    })
    .catch(err => {
      console.log(err);
    });
};
export const getupscYearQuery = dispatch => {
  Axios.get("http://localhost:8500/upsc/get-year-query")
    .then(response => {
      console.log("sent successfully", response.data);
      store.dispatch(syncActions.getUpscYearQuery(response.data));
    })
    .catch(err => {
      console.log(err);
    });
};
